import React from "react";

const Header = ({children}) => {


  return (
    <header>
      <h1>My App</h1>
      <ul>
        <li>Home</li>
        <li>About</li>
        <li>Contact</li>
      </ul>

      <h2>{children}</h2>

    </header>
  );
};

export default Header;
